,2,0,'Dịch vụ a','dich-vu-a','<div class=\"pm-mota\" style=\"font-family: Tahoma; font-size: 12px; margin: 0px 0px 5px; padding: 0px; color: rgb(142, 142, 142); font-weight: bold;\">Th&ocirc;ng tin m&ocirc; tả</div>\r\n\r\n<div class=\"pm-content stat\" style=\"font-family: Tahoma; margin: 0px; padding: 0px; color: rgb(0, 0, 0);\">Viva Riverside gi&aacute; CĐT 21tr/m2.Tiện &iacute;ch hiện đại cao cấp.Chiết khấu l&ecirc;n đến 8%<br />\r\nBạn đ&atilde; t&igrave;m được căn hộ chuẩn&quot; Kh&ocirc;ng lo ngập nước - kh&ocirc;ng sợ kẹt xe&quot; chưa?<br />\r\n<br />\r\nHotline tư vấn 24/7&nbsp;<br />\r\n<br />\r\nH&atilde;y t&igrave;m hiểu căn hộ Viva Riverside để chọn đ&uacute;ng căn hộ mơ ước nh&eacute;!<br />\r\n<br />\r\n* Tổng quan dự &aacute;n Viva Riverside.<br />\r\nCăn hộ cao cấp ViVa Riverside mặt tiền Đại lộ&nbsp;<a href=\"http://batdongsan.com.vn/ban-can-ho-chung-cu-duong-vo-van-kiet-58\" style=\"font-size: 12px; margin: 0px; text-decoration: none; padding: 0px; color: rgb(5, 86, 153);\">V&otilde; Văn Kiệt</a>, nơi cuộc sống tiện nghi, chuẩn mực cao cấp, an ninh, hiện đại, thể hiện phong c&aacute;ch đẳng cấp v&agrave; sang trọng.<br />\r\n<br />\r\nDự &aacute;n Viva Riverside l&agrave; khu phức hợp bao gồm: Khu căn hộ cao cấp, trung t&acirc;m thương mại cao cấp Co. Op Premier, y tế, thể dục thể thao, khu&ocirc;n vi&ecirc;n c&acirc;y xanh, hồ bơi, &hellip;.<br />\r\nX&acirc;y dựng 26 tầng, tổng 567 căn hộ.<br />\r\nĐơn vị thi c&ocirc;ng: H&ograve;a B&igrave;nh Construction.<br />\r\n<br />\r\n* Ưu đ&atilde;i hấp dẫn khi mua căn hộ Viva Riverside từ CĐT Vietcomreal.<br />\r\nƯu đ&atilde;i tuyệt vời trực tiếp từ Chủ Đầu Tư: Vietcomreal.<br />\r\n✓ Ph&aacute;p l&yacute; r&otilde; r&agrave;ng.<br />\r\n✓ Ng&acirc;n h&agrave;ng vietcombank bảo l&atilde;nh dự &aacute;n (đ&atilde; c&oacute; chứng thư bảo l&atilde;nh).<br />\r\n- Tặng 5 năm ph&iacute; quản l&yacute;.<br />\r\n- Thuế VAT chỉ t&iacute;nh 7%.<br />\r\n- &Acirc;n hạn gốc v&agrave; l&atilde;i ng&acirc;n h&agrave;ng đến khi nhận nh&agrave;.<br />\r\n- Chỉ thanh to&aacute;n 30% rồi đợi nhận nh&agrave;.<br />\r\n* Ti&ecirc;u chuẩn căn hộ đảm bảo.<br />\r\n<br />\r\nĐ&acirc;y l&agrave; căn hộ đạt chuẩn &quot; Kh&ocirc;ng lo ngập nước - kh&ocirc;ng sợ kẹt xe&quot; một vấn đề đau đầu nhất hiện nay tại Hồ Ch&iacute; Minh.<br />\r\n<br />\r\n* Đa dạng diện t&iacute;ch, dể d&agrave;ng chọn lựa.<br />\r\nĐa dạng về diện t&iacute;ch: (ph&ugrave; hợp mọi nhu cầu, mọi đối tượng).<br />\r\n2PN diện t&iacute;ch từ: 68m2 &ndash; 75 &ndash; 77m2.<br />\r\n2PN + 1 Ph&ograve;ng đa năng diện t&iacute;ch: 83m2 &ndash; 87 &ndash; 89m2.<br />\r\n3PN diện t&iacute;ch từ: 90m2 - 99m2.<br />\r\n<br />\r\n* Gi&aacute; cả hấp dẫn, vừa t&uacute;i tiền.<br />\r\nGi&aacute; qu&aacute; tốt: Chỉ với 21tr/m2.<br />\r\n<br />\r\n* Li&ecirc;n hệ hotline để nhận những tư vấn cực kỳ ch&iacute;nh x&aacute;c nhất.</div>\r\n','/web/uploads/images/1.jpg','Viva Riverside giá CĐT 21tr/m2.Tiện ích hiện đại cao cấp.Chiết khấu lên đến 8%','Viva Riverside giá CĐT 21tr/m2.Tiện ích hiện đại cao cấp.Chiết khấu lên đến 8%','Viva Riverside giá CĐT 21tr/m2.Tiện ích hiện đại cao cấp.Chiết khấu lên đến 8%',0,0,'0000-00-00 00:00:00',0,'0000-00-00 00:00:00',0,'Viva Riverside giá CĐT 21tr/m2.Tiện ích hiện đại cao cấp.Chiết khấu lên đến 8%',0,0,0,0,1),(7,2,0,'Dịch vụ b','dich-vu-b','<p><em>Sammobile&nbsp;</em>dẫn lời nguồn tin th&acirc;n cận cho biết, Galaxy S8 sẽ kh&ocirc;ng sử dụng module qu&eacute;t v&acirc;n tay điện dung vốn phổ biến tr&ecirc;n smartphone. Thay v&agrave;o đ&oacute;, Samsung sẽ t&iacute;ch hợp v&agrave;o c&ocirc;ng nghệ qu&eacute;t v&acirc;n tay quang học - phương ph&aacute;p l&acirc;u đời nhất để chụp ảnh v&agrave; so s&aacute;nh c&aacute;c dấu v&acirc;n tay. Bộ phận n&agrave;y sẽ được đặt ph&iacute;a dưới bề mặt m&agrave;n h&igrave;nh cảm ứng, đồng nghĩa với việc ph&iacute;m Home vật l&yacute; bị loại bỏ.</p>\r\n\r\n<p>Về nguy&ecirc;n l&yacute;, module qu&eacute;t v&acirc;n tay quang học sử dụng h&igrave;nh ảnh 2D của dấu v&acirc;n tay ghi được khi người d&ugrave;ng chạm v&agrave;o mặt cảm biến. Sau đ&oacute;, hệ thống sử dụng thuật to&aacute;n để ph&acirc;n t&iacute;ch, lưu trữ dữ liệu c&aacute;c đường r&atilde;nh, cũng như c&aacute;c phần s&aacute;ng/tối tr&ecirc;n h&igrave;nh ảnh để đối chiếu về sau. Độ bảo mật của module qu&eacute;t v&acirc;n tay dạng n&agrave;y phụ thuộc v&agrave;o độ ph&acirc;n giải của h&igrave;nh ảnh chụp được. Tức l&agrave;, h&igrave;nh ảnh độ ph&acirc;n giải cao sẽ cho khả năng bảo mật tốt hơn v&agrave; ngược lại.</p>\r\n\r\n<p>Tuy vậy, c&aacute;c nh&agrave; khoa học nhấn mạnh khả năng bảo mật của c&ocirc;ng nghệ qu&eacute;t v&acirc;n tay quang học k&eacute;m hơn so với m&aacute;y qu&eacute;t điện dung bởi n&oacute; rất dễ bị đ&aacute;nh lừa. Kẻ xấu chỉ cần một h&igrave;nh ảnh v&acirc;n tay độ ph&acirc;n giải cao l&agrave; đ&atilde; c&oacute; thể qua mặt hệ thống. Theo&nbsp;<em>Android Authority</em>, Samsung tất nhi&ecirc;n sẽ c&oacute; c&aacute;ch thức để hạn chế điều n&agrave;y nếu t&iacute;ch hợp module qu&eacute;t quang học l&ecirc;n Galaxy S8.</p>\r\n\r\n<p>Trước đ&oacute;, c&oacute; th&ocirc;ng tin cho rằng Galaxy S8 sẽ sử dụng module qu&eacute;t si&ecirc;u &acirc;m cho khả năng bảo mật cao hơn 2 phương ph&aacute;p tr&ecirc;n (do nhận diện được cả h&igrave;nh d&aacute;ng lẫn chiều s&acirc;u dấu v&acirc;n tay). N&oacute;&nbsp;sử dụng cảm biến với c&ocirc;ng nghệ Sense ID của Qualcomm, nhận dạng dấu v&acirc;n tay qua s&oacute;ng si&ecirc;u &acirc;m giống như tr&ecirc;n Le Max Pro. Tuy nhi&ecirc;n, cả Samsung lẫn Qualcomm đều kh&ocirc;ng x&aacute;c nhận điều n&agrave;y.</p>\r\n','/web/uploads/images/4.jpg','Tuy vậy, các nhà khoa học nhấn mạnh khả năng bảo mật của công nghệ ','','',0,0,'0000-00-00 00:00:00',0,'0000-00-00 00:00:00',0,'',0,0,0,0,1);

/*Table structure for table `tn_article_category` */

DROP TABLE IF EXISTS `tn_article_category`;

CREATE TABLE `tn_article_category` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `parent_id` int(11) DEFAULT '0',
  `name` varchar(255) DEFAULT NULL,
  `slug` varchar(255) DEFAULT NULL,
  `content` text,
  `image` varchar(255) DEFAULT NULL,
  `description` text,
  `keyword` varchar(255) DEFAULT NULL,
  `sorted` int(11) DEFAULT '1',
