insert  into `tn_news`(`id`,`news_category_id`,`name`,`description`,`content`,`slug`,`image`,`video`,`view`,`sorted`,`source`,`start`,`created_by`,`created_at`,`updated_by`,`updated_at`,`is_comment`,`is_publish`,`publish_date`,`status`) values (1,4,'6 smartphone chuyên selfie dưới 4 triệu đồng','Các mẫu smartphone tầm trung mới ra mắt nửa cuối năm 2016 đều được trang bị camera trước với độ phân giải cao cùng nhiều tính năng hỗ trợ chụp selfie.','<div style=\"width: 80%\">\r\n<h3>Title goes here</h3>\r\n\r\n<table border=\"1\" cellpadding=\"0\" cellspacing=\"0\" style=\"float:right; width:150px\">\r\n	<caption><strong>Table title</strong></caption>\r\n	<tbody>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n			<td>&nbsp;</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Type the text here</p>\r\n</div>\r\n','6-smartphone-chuyen-selfie-duoi-4-trieu-dong','/web/uploads/images/received_1559098634350663.jpeg','',0,0,'',1,0,'2016-11-20 21:49:22',0,'2016-11-20 21:49:29',0,1,'0000-00-00 00:00:00',1),(2,4,'iPhone 7 hàng chính hãng trễ hẹn','Các cửa hàng thông báo phải tới 10/11, iPhone 7 và iPhone 7 Plus chính hãng mới bắt đầu được bán ra ở Việt Nam, thay vì giữa tháng 10 như trước.','<p>Từ cuối th&aacute;ng 9, nhiều nh&agrave; b&aacute;n lẻ trong nước &nbsp;bắt đầu nhận đặt h&agrave;ng iPhone 7 v&agrave; 7 Plus ch&iacute;nh h&atilde;ng v&agrave; th&ocirc;ng b&aacute;o thời điểm giao h&agrave;ng từ 15/10. Đại diện một nh&agrave; ph&acirc;n phối ch&iacute;nh thức của Apple ở Việt Nam cũng cho hay bộ đ&ocirc;i iPhone mới sẽ về Việt Nam nửa cuối th&aacute;ng 10.&nbsp;</p>\r\n\r\n<p>Tuy nhi&ecirc;n, th&ocirc;ng b&aacute;o mới nhất từ c&aacute;c đơn vị n&agrave;y cho thấy, phải gần một th&aacute;ng nữa, iPhone 7 v&agrave; iPhone 7 Plus ch&iacute;nh h&atilde;ng mới c&oacute; mặt. So với đợt mở b&aacute;n đầu ti&ecirc;n của Apple bắt đầu từ 16/9, thị trường Việt Nam c&oacute; h&agrave;ng muộn tới 2 th&aacute;ng. V&agrave; thời điểm ph&aacute;t h&agrave;nh sản phẩm mới năm nay kh&ocirc;ng kh&aacute;c nhiều những năm trước.&nbsp;</p>\r\n\r\n<table align=\"center\" border=\"0\" cellpadding=\"3\" cellspacing=\"0\" class=\"tplCaption\" style=\"font-family:arial; font-size:14px; margin:0px auto 10px; max-width:100%; padding:0px; width:470px\">\r\n	<tbody>\r\n		<tr>\r\n			<td><img alt=\"Các nhà bán lẻ ra thông báo phải tới 10/11 iPhpne 7 và 7 Plus mới chính thức được bán ở Việt Nam, thay vì 15/10 như dự kiến.\" src=\"http://img.f5.sohoa.vnecdn.net/2016/10/18/Screen-Shot-2016-10-18-at-2-14-1640-8072-1476775313.png\" style=\"border:0px; font-size:0px; line-height:0; margin:0px; max-width:100%; padding:0px; width:470px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p>C&aacute;c nh&agrave; b&aacute;n lẻ ra th&ocirc;ng b&aacute;o phải tới 10/11 iPhone 7 v&agrave; 7 Plus mới ch&iacute;nh thức được b&aacute;n ở Việt Nam, thay v&igrave; 15/10 như dự kiến. Ảnh:&nbsp;<em>Telegraph</em>.</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Nguyễn Huy, đại diện hệ thống CellphoneS cho biết, việc iPhone 7 v&agrave; 7 Plus trễ hẹn l&agrave; do quyết định từ Apple v&agrave; nh&agrave; ph&acirc;n phối ở Việt Nam. Điều n&agrave;y buộc họ phải th&ocirc;ng b&aacute;o tới những người đ&atilde; đặt h&agrave;ng trước. Số đơn h&agrave;ng hiện kh&aacute; lớn v&agrave; thời gian giao h&agrave;ng l&ugrave;i lại tới 10/11, tuy nhi&ecirc;n, hầu hết kh&ocirc;ng r&uacute;t lại đặt cọc.&nbsp;</p>\r\n\r\n<p>Gi&aacute; ni&ecirc;m yết của iPhone 7 v&agrave; 7 Plus ch&iacute;nh h&atilde;ng tại nhiều hệ thống cũng kh&ocirc;ng thay đổi d&ugrave; bị muộn. Model cỡ nhỏ iPhone 7 c&oacute; gi&aacute; lần lượt 18,89, 21,79 v&agrave; 24,69 triệu đồng cho c&aacute;c dung lượng 32, 128 v&agrave; 256 GB. C&ograve;n iPhone 7 Plus c&oacute; mức khởi điểm từ 22,19 triệu đồng cho bản 32 GB. Model đắt nhất l&ecirc;n tới 27,99 triệu đồng với dung lượng 256 GB. &nbsp;</p>\r\n\r\n<p>Việc h&agrave;ng ch&iacute;nh h&atilde;ng về muộn gần một th&aacute;ng so với dự kiến cũng kh&ocirc;ng t&aacute;c động nhiều đến thị trường x&aacute;ch tay. Đại diện hệ thống Ho&agrave;ng H&agrave; Mobile cho hay gi&aacute; b&aacute;n iPhone 7 trong khoảng nửa th&aacute;ng qua kh&aacute; ổn định. Phi&ecirc;n bản thấp nhất 32 GB lu&ocirc;n duy tr&igrave; ở mức 17,2 đến 17,5 triệu đồng, thấp hơn gi&aacute; dự kiến của ch&iacute;nh h&atilde;ng khoảng 1,5 triệu đồng.&nbsp;</p>\r\n\r\n<p>D&ugrave; vậy, gi&aacute; của iPhone 7 Plus tr&ecirc;n thị trường x&aacute;ch tay hiện vẫn c&ograve;n đắt, cao hơn gi&aacute; của h&agrave;ng ch&iacute;nh h&atilde;ng. Theo c&aacute;c cửa h&agrave;ng, năm nay sức mua model m&agrave;n h&igrave;nh lớn iPhone 7 Plus tốt hơn nhiều so với iPhone 7, tr&aacute;i ngược tỷ lệ của iPhone 6, 6 Plus hay 6s, 6s Plus c&aacute;c năm trước.</p>\r\n\r\n<p>Đ&oacute; cũng l&agrave; l&yacute; do khiến cho gi&aacute; b&aacute;n của iPhone 7 Plus x&aacute;ch tay ch&ecirc;nh lệch rất nhiều so với iPhone 7, l&ecirc;n tới 5 triệu đồng thay v&igrave; khoảng 3 triệu đồng như ni&ecirc;m yết của Apple. Thậm ch&iacute;, phi&ecirc;n bản m&agrave;u đen b&oacute;ng Jet Black vẫn c&ograve;n bị &quot;h&eacute;t gi&aacute;&quot; do nguồn h&agrave;ng chưa c&oacute; nhiều.</p>\r\n','iphone-7-hang-chinh-hang-tre-hen','/web/uploads/images/Koala.jpg','',0,0,'',0,0,'2016-11-21 21:49:35',0,'2016-11-21 21:49:38',0,1,'0000-00-00 00:00:00',1),(3,8,'Nếu bạn không biết về trình tự các bước khi xây nhà','Nếu bạn không biết về trình tự các bước khi xây nhà','<p><em>bạn c&oacute; thể sẽ phải đi vay tiền để ho&agrave;n th&agrave;nh căn nh&agrave;. Việc vay tiền n&agrave;y c&oacute; thể ảnh hưởng đến vấn đề t&agrave;i ch&iacute;nh của nh&agrave; bạn. Ngo&agrave;i ra, việc dự tr&ugrave; chi ph&iacute; x&acirc;y dựng kh&ocirc;ng tốt c&oacute; thể khiến bạn bỏ qua việc thương lượng với người b&aacute;n đất về chi ph&iacute; khi phải gia cố m&oacute;ng tr&ecirc;n v&ugrave;ng đất yếu, hoặc bỏ qua chi ph&iacute; đảm bảo chất lượng cho căn nh&agrave; của m&igrave;nh như chi ph&iacute; thiết kế v&agrave; gi&aacute;m s&aacute;t. Chi ph&iacute; để khắc phục chất lượng k&eacute;m sau khi thi c&ocirc;ng c&oacute; thể chiếm từ&nbsp;</em><em>10% - 20%</em><em>&nbsp;gi&aacute; trị căn nh&agrave; của bạn.</em></p>\r\n','neu-ban-khong-biet-ve-trinh-tu-cac-buoc-khi-xay-nha','','',0,0,'',0,0,'0000-00-00 00:00:00',0,'0000-00-00 00:00:00',0,0,'0000-00-00 00:00:00',1);

