nec porta dictum nisi ac semper.</p>\r\n','Lorem ipsum dolor sit amet, consectetur adipiscing elit. Phasellus posuere tellus lacinia, imperdiet urna at, bibendum ipsum','Lorem ipsum dolor sit amet, consectetur adipiscing elit. Phasellus posuere tellus lacinia, imperdiet urna at, bibendum ipsum. Pellentesque sem erat, finibus vel massa eget, auctor placerat erat. Proin sit amet neque sagittis, bibendum felis eu, suscipit d','Quisque tempor massa augue, non ultricies metus eleifend nec.','',30,1,3),(5,0,'Tư vấn','tu-van','<blockquote>\r\n<p><strong>1) Nếu bạn kh&ocirc;ng biết về tr&igrave;nh tự c&aacute;c bước khi x&acirc;y nh&agrave; :</strong>&nbsp;c&oacute; thể bạn sẽ bị ti&ecirc;u tốn khoảng&nbsp;<strong>5% - 10%</strong>&nbsp;chi ph&iacute; cho việc sửa chữa, điều chỉnh căn nh&agrave; của m&igrave;nh. V&iacute; dụ : những vấn đề về phong thủy nếu kh&ocirc;ng dự tr&ugrave; trước, m&agrave; sau khi thi c&ocirc;ng mới xem th&igrave; chắc chắn bạn sẽ phải chỉnh sửa lại căn nh&agrave; của m&igrave;nh ; hoặc kh&ocirc;ng biết c&aacute;ch vận dụng thiết kế c&oacute; thể l&agrave;m hỏng cả kh&ocirc;ng gian, bố cục căn nh&agrave; v&agrave; phải tốn tiền chỉnh sửa.</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"/web/uploads/images/nnt-500x300-ab59b985f1-92c0b3c88abec48591ee6ff9ac250463_small.jpg\" style=\"height:71px; width:90px\" /></p>\r\n</blockquote>\r\n\r\n<blockquote>\r\n<p><strong>2) Nếu bạn kh&ocirc;ng biết c&aacute;ch dự tr&ugrave; chi ph&iacute; x&acirc;y nh&agrave; :</strong>&nbsp;bạn c&oacute; thể sẽ phải đi vay tiền để ho&agrave;n th&agrave;nh căn nh&agrave;. Việc vay tiền n&agrave;y c&oacute; thể ảnh hưởng đến vấn đề t&agrave;i ch&iacute;nh của nh&agrave; bạn. Ngo&agrave;i ra, việc dự tr&ugrave; chi ph&iacute; x&acirc;y dựng kh&ocirc;ng tốt c&oacute; thể khiến bạn bỏ qua việc thương lượng với người b&aacute;n đất về chi ph&iacute; khi phải gia cố m&oacute;ng tr&ecirc;n v&ugrave;ng đất yếu, hoặc bỏ qua chi ph&iacute; đảm bảo chất lượng cho căn nh&agrave; của m&igrave;nh như chi ph&iacute; thiết kế v&agrave; gi&aacute;m s&aacute;t. Chi ph&iacute; để khắc phục chất lượng k&eacute;m sau khi thi c&ocirc;ng c&oacute; thể chiếm từ&nbsp;<strong>10% - 20%</strong>&nbsp;gi&aacute; trị căn nh&agrave; của bạn.</p>\r\n</blockquote>\r\n\r\n<blockquote>\r\n<p><strong>3) Nếu bạn kh&ocirc;ng biết c&aacute;ch l&agrave;m r&otilde; thiết kế :&nbsp;</strong>nếu bạn kh&ocirc;ng biết c&aacute;ch l&agrave;m r&otilde; thiết kế ngay từ ban đầu, c&oacute; thể bạn sẽ phải tốn th&ecirc;m từ&nbsp;<strong>10% - 20%</strong>&nbsp;cho chi ph&iacute; thiết kế v&igrave; việc l&agrave;m lại. Ngo&agrave;i ra, việc l&agrave;m lại thiết kế c&oacute; thể ảnh hưởng đến hiệu quả c&ocirc;ng việc của người l&agrave;m thiết kế bởi v&igrave; thực sự kh&ocirc;ng c&oacute; c&ocirc;ng việc g&igrave; ch&aacute;n ng&aacute;n hơn l&agrave; phải sửa đi, sửa lại một sản phẩm do m&igrave;nh l&agrave;m ra. Chưa kể c&ograve;n ảnh hưởng đến quan hệ giữa chủ nh&agrave; v&agrave; b&ecirc;n thiết kế nếu như &yacute; kiến của bạn thay đổi li&ecirc;n tục. Cho n&ecirc;n, bạn cần c&oacute; một bộ thư viện mẫu nh&agrave; để tham khảo trước khi bắt đầu l&agrave;m việc với thiết kế về căn nh&agrave; của m&igrave;nh. Khi đ&oacute;, những &yacute; tưởng về căn nh&agrave; của bạn sẽ trở n&ecirc;n r&otilde; r&agrave;ng hơn rất nhiều.</p>\r\n</blockquote>\r\n\r\n<blockquote>\r\n<p><strong>4) Nếu bạn kh&ocirc;ng biết c&aacute;ch đ&aacute;nh gi&aacute; chọn thầu :</strong>&nbsp;kh&ocirc;ng c&oacute; g&igrave; sai lầm hơn việc chọn phải một nh&agrave; thầu thiết kế / thi c&ocirc;ng / gi&aacute;m s&aacute;t tệ hại. Kết quả của việc đ&aacute;nh gi&aacute; v&agrave; chọn thầu sai sẽ dẫn đến c&ocirc;ng tr&igrave;nh của bạn bị ảnh hưởng về nhiều kh&iacute;a cạnh như ph&aacute;t sinh chi ph&iacute;, tiến độ k&eacute;o d&agrave;i, chất lượng kh&ocirc;ng đảm bảo... Việc khắc phục những hệ lụy n&agrave;y kh&ocirc;ng bao giờ l&agrave; nhỏ. Thậm ch&iacute; c&oacute; trường hợp phải ti&ecirc;u tốn từ&nbsp;<strong>20% - 30%</strong>gi&aacute; trị căn nh&agrave; để khắc phục.</p>\r\n</blockquote>\r\n\r\n<blockquote>\r\n<p><strong>5) Nếu bạn kh&ocirc;ng biết l&agrave;m r&otilde; hợp đồng :</strong>&nbsp;nếu bạn kh&ocirc;ng biết c&aacute;ch l&agrave;m r&otilde; hợp đồng, chắc chắn khi c&oacute; sự cố hoặc khi nh&agrave; thầu cố &yacute; &quot;l&agrave;m m&igrave;nh l&agrave;m mẩy&quot; th&igrave; bạn sẽ l&agrave; người chịu thiệt. Bạn sẽ l&agrave;m g&igrave; nếu nh&agrave; thầu l&agrave;m chậm tiến độ m&agrave; trong thỏa thuận th&igrave; chẳng c&oacute; điều kiện g&igrave; để r&agrave;ng buộc ? Bạn sẽ l&agrave;m g&igrave; nếu bạn muốn ngưng hợp đồng v&igrave; nh&agrave; thầu l&agrave;m việc kh&ocirc;ng đảm bảo chất lượng ? Chắc chắn những trường hợp đ&oacute; sẽ l&agrave;m mệt mỏi cả đ&ocirc;i b&ecirc;n nếu kh&ocirc;ng được quy định trước, đồng thời bạn c&ograve;n phải chịu thiệt về tiền bạc, thời gian nếu kh&ocirc;ng chuẩn bị kỹ c&agrave;ng.</p>\r\n</blockquote>\r\n\r\n<blockquote><strong>6) Nếu bạn kh&ocirc;ng biết những kh&acirc;u quan trọng cần phải kiểm tra :&nbsp;</strong>c&oacute; thể nh&agrave; thầu / gi&aacute;m s&aacute;t sẽ qua mặt bạn, v&igrave; đơn giản chỉ l&agrave; bạn kh&ocirc;ng biết. Hoặc sự sơ s&oacute;t, thiếu cẩn trọng của nh&agrave; thầu / gi&aacute;m s&aacute;t c&oacute; thể l&agrave;m ảnh hưởng đến chất lượng c&ocirc;ng tr&igrave;nh nếu bỏ qua một v&agrave;i kh&acirc;u quan trọng. Việc bạn biết những kh&acirc;u quan trọng cần kiểm tra khiến cho nh&agrave; thầu / gi&aacute;m s&aacute;t phải nể bạn hơn v&agrave; phải kỹ lưỡng hơn trong to&agrave;n bộ c&ocirc;ng tr&igrave;nh. Điều đ&oacute; gi&uacute;p cho c&ocirc;ng tr&igrave;nh của bạn chắc chắn &iacute;t sai s&oacute;t hơn v&agrave; chất lượng đảm bảo hơn.</blockquote>\r\n\r\n<blockquote><strong>7) Nếu bạn kh&ocirc;ng biết về những quy định khi x&acirc;y nh&agrave; :</strong>&nbsp;c&oacute; thể bạn sẽ phải chi ti&ecirc;u nhiều hơn cho việc x&acirc;y nh&agrave; của m&igrave;nh trong trường hợp lỡ như bạn x&acirc;y nh&agrave; bị kh&aacute;c với giấy ph&eacute;p được cấp. C&oacute; nhiều trường hợp, thậm ch&iacute; nh&agrave; thầu cũng kh&ocirc;ng nắm r&otilde; luật quy định về việc x&acirc;y dựng kh&aacute;c với giấy ph&eacute;p. Trong một số trường hợp bạn bị phạt h&agrave;nh ch&iacute;nh, phải ph&aacute; dỡ phần x&acirc;y tr&aacute;i ph&eacute;p ; một số trường hợp kh&aacute;c bạn chỉ bị phạt h&agrave;nh ch&iacute;nh m&agrave; kh&ocirc;ng cần ph&aacute; dỡ ; thậm ch&iacute; c&oacute; cả trường hợp mặc d&ugrave; x&acirc;y sai ph&eacute;p nhưng bạn kh&ocirc;ng bị phạt cũng kh&ocirc;ng bị ph&aacute; dỡ. Tất cả những điều đ&oacute; đều c&oacute; quy định rất r&otilde;, nhưng nếu như bạn kh&ocirc;ng nắm bắt th&igrave; dĩ nhi&ecirc;n bạn sẽ phải chịu thiệt th&ograve;i về phần m&igrave;nh rồi.</blockquote>\r\n','','','','',75,1,1),(6,0,'Tin tức','tin-tuc','','','','','',57,0,1),(7,0,'Liên hệ','lien-he','<p><iframe frameborder=\"0\" height=\"450\" src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d6592.660851715465!2d106.6146472899516!3d10.732971854713854!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x31752dc334067e89%3A0x48f1936395b3114b!2zMzYvMjcvNjEgQsO5aSBUxrAgVG_DoG4sIEFuIEzhuqFjLCBCw6xuaCBUw6JuLCBI4buTIENow60gTWluaCwgVmlldG5hbQ!5e0!3m2!1sen!2s!4v1490523632330\" style=\"border:0\" width=\"100%\"></iframe></p>\r\n','','','','',88,1,2),(8,0,'Home','home','','Trang chu','Xay dung cac loai nha tien che, nha biet thu','Xay dung cac loai nha tien che','',838,1,0),(9,0,'Tin tuc detail','tin-tuc-detail','','','','','',36,1,3),(10,0,'contruction-detail','contruction-detail','','','','','/web/uploads/images/received_1559098641017329.jpeg',30,1,3),(11,0,'Dich vu','dich-vu','','','','','',2,1,3);

/*Table structure for table `tn_post` */

DROP TABLE IF EXISTS `tn_post`;

CREATE TABLE `tn_post` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `post_category_id` int(11) DEFAULT NULL,
  `name` varchar(255) DEFAULT NULL,
  `slug` varchar(255) DEFAULT NULL,
  `description` text,
  `content` text,
  `img` varchar(255) DEFAULT NULL,
  `view` int(11) DEFAULT NULL,
  `sorted` int(11) DEFAULT NULL,
  `created_by` int(11) DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `updated_by` int(11) DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `status` tinyint(1) DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

/*Data for the table `tn_post` */

/*Table structure for table `tn_post_category` */

DROP TABLE IF EXISTS `tn_post_category`;

CREATE TABLE `tn_post_category` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL,
  `slug` varchar(255) NOT NULL,
  `description` text,
  `content` text,
  `img` varchar(255) DEFAULT NULL,
  `sorted` int(11) DEFAULT NULL,
  `status` tinyint(1) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

/*Data for the table `tn_post_category` */

/*Table structure for table `tn_setting` */

DROP TABLE IF EXISTS `tn_setting`;

CREATE TABLE `tn_setting` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL,
  `code` varchar(55) NOT NULL,
  `value` varchar(55) DEFAULT NULL,
  `default` varchar(55) DEFAULT NULL,
  `sorted` int(11) DEFAULT '1',
  `input` enum('text','password','submit','reset','radio','checkbox','number','email','select','textarea','image') DEFAULT 'text',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=6 DEFAULT CHARSET=utf8;

